import React from "react";

class Navbar extends Component {

  render() {

  return (
        <div>
        <div className="navbar-fixed">
          <nav>
            <div className="nav-wrapper deep-purple darken-2">
              <Link to="/dashboard" className="brand-logo" style={{ margin: "0 0 0 10px" }}>Open<b>House</b></Link>
              <ul className="right hide-on-med-and-down">
                <li><a href="sass.html">Page 1</a></li>
                <li><a href="sass.html">Page 2</a></li>
                <li><a href="badges.html">Page 3</a></li>
                <li><a href="collapsible.html">{user.name.split(" ")[0]}'s Profile</a></li>
                <li><a onClick={this.onLogoutClick} href="mobile.html">Logout</a></li>
              </ul>
            </div>
          </nav>
        </div>
        <Dashboard />
        </div>
      );
    }
  }

export default Navbar;
